import React from "react";
import { PrimeReactProvider } from "primereact/api";
import "primereact/resources/themes/lara-light-cyan/theme.css";
import Navbar from "./components/Navbar";
import "./App.css";

const App = () => {
  return (
    <PrimeReactProvider>
      <Navbar />
    </PrimeReactProvider>
  );
};

const AppWithRouter = () => (
  <Router>
    <App />
  </Router>
);

export default AppWithRouter;
